namespace MinimumWindowSubstring
{
    internal class Program
    {
        static void Main(string[] args)
        {
            

            var a = "haha";
            var b=a.IndexOf("c");
            var c = a.Remove(0,1);
            var input = "";
            var sub = "";
            Console.WriteLine(MinWindow(input,sub));
            string MinWindow(string s, string t)
            {
                var minLgh = s.Length;
                var result = "";
                var i = 0;
                var j = 0;
                var isContinue = true;
                var str = s;
                while (isContinue)
                {
                    if (j < s.Length)
                    {
                        str = s.Substring(i, j - i + 1);
                    }
                    
                    if (!CheckExist(str, t))
                    {
                        if(j < s.Length)
                        {
                            j++;
                        }
                        else
                        {
                            isContinue = false;
                        }
                    }
                    else
                    {
                        if (str.Length <= minLgh)
                        {
                            result = str;
                            minLgh = str.Length;
                        }
                        i++;
                    }
                }
                return result;
            }

            bool CheckExist(string sourceString, string checkString)
            {
                foreach (var letter in checkString)
                {
                    var i = sourceString.IndexOf(letter);
                    if (i >= 0)
                    {
                        sourceString = sourceString.Remove(i, 1);
                    }
                    else
                    {
                        return false;
                    }
                }
                return true;
            }
        }
    }
}
